import React, { useState } from "react";
import { withStyles } from "@material-ui/core/styles";
import ShoppingCartIcon from "@material-ui/icons/ShoppingCart";
import IconButton from "@material-ui/core/IconButton";
import Badge from "@material-ui/core/Badge";
import Korpica from "./Korpica";
import "./Header.css";

const StyledBadge = withStyles((theme) => ({
  badge: {
    right: -3,
    top: 13,
    border: `1px solid ${theme.palette.background.paper}`,
    padding: "0 1px",
  },
}))(Badge);

function _Header({ cartIco, setOtvorena }) {
  return (
    <div className="header">
      <div className="ikonica">
        <IconButton aria-label="cart" onClick={() => setOtvorena(true)}>
          <StyledBadge badgeContent={cartIco} color="secondary">
            <ShoppingCartIcon />
          </StyledBadge>
        </IconButton>
      </div>
    </div>
  );
}

export default function Header({ cartIco }) {
  const [otvorena, setOtvorena] = useState(false);

  if (otvorena) {
    {
      _Header(cartIco, setOtvorena);
      //return <Korpica></Korpica>;
    }
  } else {
    {
      _Header(cartIco, setOtvorena);
    }
  }
}
